import { Typography ,TextField, Button} from '@mui/material';
import React, { useState } from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { useNavigate } from "react-router-dom";


const FullScreenContainer = styled('div')`
  height: 100vh;
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #eeeeee; 
`;

const StyledPaper = styled('div')`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 32px 64px;
  max-width: 450px;
  width: 28.5rem;
  background-color: white;
  border-radius: 16px;
`;

const StyledTypography = styled('div')`
  display: flex;
  width:328px;
  height:33px;
  justify-content: center;
  font-weight: 800;
  line-height: 1.2;
  font-size: 1.75rem;
  font-family: Baikal, Inter, sans-serif;
  letter-spacing: -0.025em;
  text-align: center;
  margin: 0.5rem 0px 1.25rem;
`;
const StyledForm=styled('div')`

width:328px;
margin:2px;
 
  
`
const StyledInput= styled('div')`
 text-align:left;
 width:inherit;


`
const StyledText=styled('div')`
   color: rgb(58, 58, 58);
    font-size: 0.75rem;
    margin-bottom: 0.3rem;
    display: inline-block;
    font-weight:500;
     letter-spacing: -0.01em;

`

const StyledTextField = styled(TextField)`
  &&{
    width: 100%;
    
    
    & .MuiInputBase-root {
      padding: 0px 1rem;
      height: 3rem;
      display: flex;
      align-items: center;
      font-size: 1rem;
      color: rgb(12, 12, 12);
      font-weight: 500;
      border-radius: 8px;
      // border: 1px solid rgb(206, 206, 206);
      background: rgb(255, 255, 255);
      transition: border-color 100ms cubic-bezier(0.4, 0, 0.2, 1) 0ms;
    }

    & .MuiOutlinedInput-notchedOutline {
      border-color: rgb(203, 213, 225);
    }

    & .MuiOutlinedInput-root.Mui-focused .MuiOutlinedInput-notchedOutline {
     
      transition: border-color 300ms cubic-bezier(0.4, 0, 0.2, 1) 0ms, outline 300ms cubic-bezier(0.4, 0, 0.2, 1) 0ms;
    }

    & .MuiFormLabel-root {
      font-weight: 500;
    }
  
`;

const StyledBottomText=styled('div')`
    display:flex;
    flex-wrap: wrap ;
    font-size: 0.75rem;
    line-height: 1.4;
    font-family: Inter, sans-serif;
    margin: 1rem 0px 0.25rem;
    font-weight: 500;

}`

const StyledLink = styled(Link)`
  color: #007aff;
  font-weight: bold;
  text-decoration: none; 
  &:hover {
   
    cursor: pointer;
  }
`;

const StyledButton =styled('div')`
    display: inline-flex;
  
    align-items: center;
    
    justify-content: center;
    position: relative;
    box-sizing: border-box;
    -webkit-tap-highlight-color: transparent;
    outline: 0px;
    border: 0px;
    margin: 12px 0px 0px;
    cursor: pointer;
    user-select: none;
    vertical-align: middle;
    appearance: none;
    text-decoration: none;
    line-height: 1;
    font-family: Inter, sans-serif;
    min-width: 64px;
    padding: 8px 22px;
    border-radius: 8px;
    width: 100%;
    box-shadow: none;
    text-transform: none;
    text-align: center;
    font-size: 1.125rem;
    height: 3rem;
    color: rgb(255, 255, 255);
    background-color: rgb(16, 129, 232);
    font-weight: 600;
    transition: all 500ms cubic-bezier(0.4, 0, 0.2, 1) 0ms;

`

export const Login = () => {
  
  const navigate=useNavigate();
  
  return (
    <FullScreenContainer>
      <StyledPaper>
        <StyledTypography>
          Log in
        </StyledTypography>
       <StyledForm>
          <StyledInput>
            <StyledText>
              Email or Mobile Number
            </StyledText>
            <StyledTextField
               variant='outlined'
               placeholder='Email or Mobile Number'
            />
        
            </StyledInput>
            <StyledBottomText>
         By clicking Continue, you agree to our
         <StyledLink to="/terms">Terms & Conditions </StyledLink> and
         <StyledLink to="/terms"> Privacy Policy</StyledLink>.
   
         </StyledBottomText>
         <StyledButton>
          Continue
         </StyledButton>
          
       </StyledForm>

       <StyledBottomText>
        Don't have an Account?
        <StyledLink to='/signup'>Sign up instead</StyledLink>
       </StyledBottomText>
      </StyledPaper>
    </FullScreenContainer>
  );
};
